import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Header.css';
import logo from '../Assets/v for v logo 1.png';

const Header = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  React.useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <header className="header">
      <nav className="nav-container">
        <div className="logo">
          <Link to="/">
            <img 
              src={logo} 
              alt="Logo" 
              className="logo-image"
              onError={(e) => {
                console.error('Error loading logo');
                e.target.style.display = 'none';
              }}
            />
          </Link>
        </div>
        
        <button 
          className="mobile-menu-button" 
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <span className={`hamburger ${isOpen ? 'active' : ''}`}></span>
        </button>

        <div className={`nav-menu ${isOpen ? 'active' : ''}`}>
          <Link to="/courses" onClick={() => setIsOpen(false)}>Courses</Link>
          <Link to="/professors" onClick={() => setIsOpen(false)}>Professors</Link>
          <Link to="/study-tools" onClick={() => setIsOpen(false)}>Study Tools</Link>
          <Link to="/contact-us" onClick={() => setIsOpen(false)}>Contact</Link>
          <Link to="/login-signup" onClick={() => setIsOpen(false)}>Login</Link>
        </div>
      </nav>
      <Link to="/login-signup">
        <button className="login-btn">Login/Signup</button>
      </Link>
    </header>
  );
};

export default Header;
